import React from 'react'


export default function FormButton({ buttonTitle, buttonColor}) {

  const buttonContainer = {
    width: 45, 
    height: 45,
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: buttonColor == undefined ? Colors.primaryRed : buttonColor,
    borderRadius: 10
  }

  return (
    <div style={buttonContainer}>
      <Text style={styles.buttonText}>{buttonTitle.toUpperCase()}</Text>
    </div>
  )
}

// Design of form button 
const styles = StyleSheet.create({

  buttonText: {
    fontFamily: Fonts.normal,
    fontSize: 16,
    color: '#fff'
  }
})
